--select distinct e1.extref from externalid e1 left join externalid e2 on e1.extref=e2.extref and e1.id != e2.id
--where e1.pid = '263320a0-f78d-11e6-9f80-eba3bd15b1e9' and e2.pid='263320a0-f78d-11e6-9f80-eba3bd15b1e9'
--and e1."source"='SERIES_ID' and e2."source"='SERIES_ID';

-- Script in ~/scripts/sky/dupe-seriesid.sh to get available nodes
select
	'=IF(INDIRECT("C" & ROW())=INDIRECT("C" & ROW()-1),INDIRECT("A" & ROW()-1),INDIRECT("A" & ROW() - 1) + 1)' as seriesNumber,
	'' as "include?",
	e.extref as seriesId,
	e.nodeid as nodeId,
	e1.extref providerSeriesId,
-- 	d1."values"->>0 as uriId,
	d2."values"->>0 as title,
  d3."values"->>0 as accessChannel,
	'=HYPERLINK(CONCATENATE("https://cms.atom.nowtv.com/editor/#/asset-curation/CATALOGUE/SERIES/",INDIRECT("D" & ROW()), "?productCode=nowtv&territoryCode=gb"), "Atom Link")' as link
-- 	d4."values"->>0 as episode,
-- 	d5."values" as season
from externalid e
left JOIN externalid e1 on e1.nodeid=e.nodeid AND e1.source='PROVIDER_SERIES_ID'
left JOIN datagramvariant d2 on d2.nodeid=e.nodeid AND d2.name='TITLE' and d2.context is null
left JOIN datagramvariant d3 on d3.nodeid=e.nodeid AND d3.name='ACCESS_CHANNEL' and d3.context is null
